@-moz-document url-prefix("http://fsincere.free.fr/isn") {
#navigation {
    float: none;
    width: 100%;
    background: none;
    padding-bottom: 2em;
}
#navigation hr {
    display: none;
}
#navigation ul {
    padding: 0;
}
#navigation a {
    padding: 0;
    color: #fff;
}
.nav_actif,
.nav_actif a {
    border-radius: 0;
    background: none !important;
}
#navigation a:hover {
    background: #0000001c !important;
}

body {
    background: #1E1E1E;
}
#contenu {
    margin-left: 0;
    background: #2b2b2b;
    color: #FFF;
}
#contenu strong {
    color: #C2C2C2;
}
#contenu a,
#contenu a:hover,
#contenu a:focus {
    color: #A1C8D7;
}
#contenu img {
    box-shadow: none;
}

.python_to_html,
pre {
    background: #515151;
    color: #cacaca;
    box-shadow: none;
}
span[style="background:#FFFF66"] {
    background: #cacaca !important;
}
.style_10,
.style_11 {
    color: #cacaca;
}
.definition,
.style_9 {
    color: #93C2FF;
}
.stdout,
.style_14 {
    color: #C6C6FF;
}
.builtin,
.style_8 {
    color: #e889e8;
}
.comment,
.style_1 {
    color: #FF6565;
}
.stderr {
    color: #FF4545;
}
.shell {
    color: #f00;
}
.style_2 {
    color: #ffc14b;
}
}

@-moz-document domain("downloads.khinsider.com") {
body,
#page {
    background: #1e1e1e !important;
    color: #eaeaea;
}
input {
    background-color: #333232 !important;
    border: #5f5f5f solid 1px !important;
    color: white !important;
}
p,
a {
    color: #cfcbcb;
}
b,
font {
    color: #2798d1;
}
h1,
h2 {
    color: #0af !important;
}
h3 {
    color: #2798d1 !important;
}
#faux {
    background: none !important;
}
#lmenu,
#rmenu .moduletable {
    background-color: #242424 !important;
    height: 1680px !important;
}
#lmenu,
#rmenu a {
    color: white !important;
    text-align: left !important;
}
#alpha .moduletable h3,
#rmenu .moduletable h3 {
    background: #0000;
    color: #c3c3c3 !important;
}
.moduletable td {
    background: none !important;
}
#delta {
    /* Permalink - use to edit and share this gradient: http://colorzilla.com/gradient-editor/#000000+0,000000+100&0+0,0.65+100 */
    background: -moz-linear-gradient(top, rgba(0, 0, 0, 0) 0%, rgba(0, 0, 0, 0.65) 100%) !important;
    /* FF3.6-15 */
    background: -webkit-linear-gradient(top, rgba(0, 0, 0, 0) 0%, rgba(0, 0, 0, 0.65) 100%) !important;
    /* Chrome10-25,Safari5.1-6 */
    background: linear-gradient(to bottom, rgba(0, 0, 0, 0) 0%, rgba(0, 0, 0, 0.65) 100%) !important;
    /* W3C, IE10+, FF16+, Chrome26+, Opera12+, Safari7+ */
}
#songlist th {
    background-color: #444 !important;
}
#songlist tr:hover,
#top40 tr:hover {
    background-color: #444;
}
.audioplayer {
    background: #313131 !important
}
.audioplayerPlayPause:hover,
.audioplayerPlayPause:focus,
.audioplayerVolume:hover,
.audioplayerVolume:focus,
.audioplayerVolumeBar {
    background: #242424;
}
.audioplayerVolumeBarLevel {
    background: -moz-linear-gradient( left, #959595, #aaa);
}
.audioplayerBarPlayed {
    background: #b7b7b7 !important;
}
.clickable-row a {
    color: white !important;
}
span.pagenav:last-child {
    background: #2798d1;
}
}

@-moz-document domain("canijailbreak.com") {
body {
    background-color:#222;
    color:#ddd
}
h1, h2, h3, h4, h5, h6, .h1, .h2, .h3, .h4, .h5, .h6{
    color: #fff;
}
a:hover, a:focus{
    color: #61adf9;
}
a{
    color: #54abf9;
}

img[alt="Just a Penguin"]{
    filter: invert(10%);
}
.btn-info{
    background-color: #666;
}
.btn-info:hover{
    background-color: #777;
}
.well{
    background-color: #262626;
    height: 340px;
}

.text-success {
    color: #67bb6a;
}
.text-warning {
    color: #ffb03b;
}
.text-danger {
    color: #ec6065;
}
}

